CFG_DICT = {
    "verbosity":None,
    "trace":None,
}

class Config(BaseConfig):
    
    RAM_START = 0x0000
    RAM_END = 0x7FFF

    ROM_START = 0x8000
    ROM_END = 0xFFFF

def generate_random(_c,_op,_addr): # Code 12A8
    #print('GENERATE RANDOM')
    val = random.randint(0,255)
    memory.write_byte(0x1338,val)
    val = random.randint(0,255)
    cpu.accu_a.set(val)   
    return 0x39 # RTS

def long_delay(_c,_op,_addr): # Code 09D6
    #print('LONG DELAY')
    #time.sleep(1)
    return 0x12
    
def long_delay_done(_c,_op,_addr): # Code 09D7
    #print('LONG DELAY DONE')
    #raise Exception('NOT IMPLEMENTED')
    return 0x39

def endless_loop(_c,_op,_addr): # Code 10B5
    print('ENDLESS LOOP')
    raise Exception('NOT IMPLEMENTED')
    
    
def not_valid(_c,_op,_addr): # Anything out of range
    print('Invalid read',hex(_addr),'from',hex(_op))
    raise Exception('INVALID RAM READ')
    
def rom_functions(_c,_op,addr):
    if addr==0xA002:
        return 0xC1
    if addr==0xA003:
        return 0x00
    if addr==0xA000:
        return 0xC0
    if addr==0xA001:
        return 0x00
    
    if addr==0xC100:        
        print(chr(cpu.accu_a.value),end='')
        #raise Exception('NOT IMPLEMENTED')
        return 0x39 # RTS
    if addr==0xC000 or addr==0xC001:
        k = None
        while not k:
            k = wait_key()
        cpu.accu_a.set(ord(k))
        cpu.cc_register.set(0)
        #print('INPUT CHAR',k)
        return 0x39 # RTS
    
    print('Invalid ROM read',hex(addr),'from',hex(_op))
    raise Exception('INVALID ROM READ')

cfg = Config(CFG_DICT)
memory = Memory(cfg)

memory.add_read_byte_callback(generate_random,0x12A8)
memory.add_read_byte_callback(long_delay,0x09D6)
memory.add_read_byte_callback(long_delay_done,0x09D7)
memory.add_read_byte_callback(endless_loop,0x10B5)

memory.add_read_byte_callback(not_valid,0x3F18,0x7FFF)
memory.add_read_byte_callback(rom_functions,0x8000,0xFFFF)

memory.load(0x600,bytearray(BIN))

cpu = CPU(memory, cfg)

cpu.test_run(start=0x600,end=None)


